"use strict";(self.webpackChunk=self.webpackChunk||[]).push([["8104"],{7515:function(s,n,a){a.r(n),a.d(n,{default:function(){return e}});var t=a(1147);let l=["innerHTML"],e={setup:()=>({html:""}),render:()=>((0,t.wg)(),(0,t.iD)("div",{class:"mi-doc-markdown-body",innerHTML:'<h1>Field 输入框</h1>\n<div class="mi-doc-card"><h3 id="jie-shao" tabindex="-1">介绍</h3>\n<p>用户可以在文本框内输入或编辑文字。</p>\n</div><div class="mi-doc-card"><h3 id="yin-ru" tabindex="-1">引入</h3>\n<p>通过以下方式来全局注册组件，更多注册方式请参考<a href="#/zh-CN/advanced-usage#zu-jian-zhu-ce" target="_blank">组件注册</a>。</p>\n<pre><code class="language-js"><span class="hljs-keyword">import</span> { createApp } <span class="hljs-keyword">from</span> <span class="hljs-string">&#x27;vue&#x27;</span>;\n<span class="hljs-keyword">import</span> { <span class="hljs-title class_">Field</span>, <span class="hljs-title class_">CellGroup</span> } <span class="hljs-keyword">from</span> <span class="hljs-string">&#x27;@miracle-web/ui&#x27;</span>;\n\n<span class="hljs-keyword">const</span> app = <span class="hljs-title function_">createApp</span>();\napp.<span class="hljs-title function_">use</span>(<span class="hljs-title class_">Field</span>);\napp.<span class="hljs-title function_">use</span>(<span class="hljs-title class_">CellGroup</span>);\n</code></pre>\n</div><h2 id="dai-ma-yan-shi" tabindex="-1">代码演示</h2>\n<div class="mi-doc-card"><h3 id="ji-chu-yong-fa" tabindex="-1">基础用法</h3>\n<p>可以通过 <code>v-model</code> 双向绑定输入框的值，通过 <code>placeholder</code> 设置占位提示文字。</p>\n<pre><code class="language-html"><span class="hljs-comment">&lt;!-- 可以使用 CellGroup 作为容器 --&gt;</span>\n<span class="hljs-tag">&lt;<span class="hljs-name">mi-cell-group</span> <span class="hljs-attr">inset</span>&gt;</span>\n    <span class="hljs-tag">&lt;<span class="hljs-name">mi-field</span> <span class="hljs-attr">v-model</span>=<span class="hljs-string">&quot;value&quot;</span> <span class="hljs-attr">label</span>=<span class="hljs-string">&quot;文本&quot;</span> <span class="hljs-attr">placeholder</span>=<span class="hljs-string">&quot;请输入用户名&quot;</span> /&gt;</span>\n<span class="hljs-tag">&lt;/<span class="hljs-name">mi-cell-group</span>&gt;</span>\n</code></pre>\n<pre><code class="language-js"><span class="hljs-keyword">import</span> { ref } <span class="hljs-keyword">from</span> <span class="hljs-string">&#x27;vue&#x27;</span>;\n\n<span class="hljs-keyword">export</span> <span class="hljs-keyword">default</span> {\n    <span class="hljs-title function_">setup</span>(<span class="hljs-params"></span>) {\n        <span class="hljs-keyword">const</span> value = <span class="hljs-title function_">ref</span>(<span class="hljs-string">&#x27;&#x27;</span>);\n        <span class="hljs-keyword">return</span> { value };\n    },\n};\n</code></pre>\n</div><div class="mi-doc-card"><h3 id="zi-ding-yi-lei-xing" tabindex="-1">自定义类型</h3>\n<p>根据 <code>type</code> 属性定义不同类型的输入框，默认值为 <code>text</code>。</p>\n<pre><code class="language-html"><span class="hljs-tag">&lt;<span class="hljs-name">mi-cell-group</span> <span class="hljs-attr">inset</span>&gt;</span>\n    <span class="hljs-comment">&lt;!-- 输入任意文本 --&gt;</span>\n    <span class="hljs-tag">&lt;<span class="hljs-name">mi-field</span> <span class="hljs-attr">v-model</span>=<span class="hljs-string">&quot;text&quot;</span> <span class="hljs-attr">label</span>=<span class="hljs-string">&quot;文本&quot;</span> /&gt;</span>\n    <span class="hljs-comment">&lt;!-- 输入手机号，调起手机号键盘 --&gt;</span>\n    <span class="hljs-tag">&lt;<span class="hljs-name">mi-field</span> <span class="hljs-attr">v-model</span>=<span class="hljs-string">&quot;tel&quot;</span> <span class="hljs-attr">type</span>=<span class="hljs-string">&quot;tel&quot;</span> <span class="hljs-attr">label</span>=<span class="hljs-string">&quot;手机号&quot;</span> /&gt;</span>\n    <span class="hljs-comment">&lt;!-- 允许输入正整数，调起纯数字键盘 --&gt;</span>\n    <span class="hljs-tag">&lt;<span class="hljs-name">mi-field</span> <span class="hljs-attr">v-model</span>=<span class="hljs-string">&quot;digit&quot;</span> <span class="hljs-attr">type</span>=<span class="hljs-string">&quot;digit&quot;</span> <span class="hljs-attr">label</span>=<span class="hljs-string">&quot;整数&quot;</span> /&gt;</span>\n    <span class="hljs-comment">&lt;!-- 允许输入数字，调起带符号的纯数字键盘 --&gt;</span>\n    <span class="hljs-tag">&lt;<span class="hljs-name">mi-field</span> <span class="hljs-attr">v-model</span>=<span class="hljs-string">&quot;number&quot;</span> <span class="hljs-attr">type</span>=<span class="hljs-string">&quot;number&quot;</span> <span class="hljs-attr">label</span>=<span class="hljs-string">&quot;数字&quot;</span> /&gt;</span>\n    <span class="hljs-comment">&lt;!-- 输入密码 --&gt;</span>\n    <span class="hljs-tag">&lt;<span class="hljs-name">mi-field</span> <span class="hljs-attr">v-model</span>=<span class="hljs-string">&quot;password&quot;</span> <span class="hljs-attr">type</span>=<span class="hljs-string">&quot;password&quot;</span> <span class="hljs-attr">label</span>=<span class="hljs-string">&quot;密码&quot;</span> /&gt;</span>\n<span class="hljs-tag">&lt;/<span class="hljs-name">mi-cell-group</span>&gt;</span>\n</code></pre>\n<pre><code class="language-js"><span class="hljs-keyword">import</span> { ref } <span class="hljs-keyword">from</span> <span class="hljs-string">&#x27;vue&#x27;</span>;\n\n<span class="hljs-keyword">export</span> <span class="hljs-keyword">default</span> {\n    <span class="hljs-title function_">setup</span>(<span class="hljs-params"></span>) {\n        <span class="hljs-keyword">const</span> tel = <span class="hljs-title function_">ref</span>(<span class="hljs-string">&#x27;&#x27;</span>);\n        <span class="hljs-keyword">const</span> text = <span class="hljs-title function_">ref</span>(<span class="hljs-string">&#x27;&#x27;</span>);\n        <span class="hljs-keyword">const</span> digit = <span class="hljs-title function_">ref</span>(<span class="hljs-string">&#x27;&#x27;</span>);\n        <span class="hljs-keyword">const</span> number = <span class="hljs-title function_">ref</span>(<span class="hljs-string">&#x27;&#x27;</span>);\n        <span class="hljs-keyword">const</span> password = <span class="hljs-title function_">ref</span>(<span class="hljs-string">&#x27;&#x27;</span>);\n\n        <span class="hljs-keyword">return</span> { tel, text, digit, number, password };\n    },\n};\n</code></pre>\n</div><div class="mi-doc-card"><h3 id="jin-yong-shu-ru-kuang" tabindex="-1">禁用输入框</h3>\n<p>通过 <code>readonly</code> 将输入框设置为只读状态，通过 <code>disabled</code> 将输入框设置为禁用状态。</p>\n<pre><code class="language-html"><span class="hljs-tag">&lt;<span class="hljs-name">mi-cell-group</span> <span class="hljs-attr">inset</span>&gt;</span>\n    <span class="hljs-tag">&lt;<span class="hljs-name">mi-field</span> <span class="hljs-attr">label</span>=<span class="hljs-string">&quot;文本&quot;</span> <span class="hljs-attr">model-value</span>=<span class="hljs-string">&quot;输入框只读&quot;</span> <span class="hljs-attr">readonly</span> /&gt;</span>\n    <span class="hljs-tag">&lt;<span class="hljs-name">mi-field</span> <span class="hljs-attr">label</span>=<span class="hljs-string">&quot;文本&quot;</span> <span class="hljs-attr">model-value</span>=<span class="hljs-string">&quot;输入框已禁用&quot;</span> <span class="hljs-attr">disabled</span> /&gt;</span>\n<span class="hljs-tag">&lt;/<span class="hljs-name">mi-cell-group</span>&gt;</span>\n</code></pre>\n</div><div class="mi-doc-card"><h3 id="xian-shi-tu-biao" tabindex="-1">显示图标</h3>\n<p>通过 <code>left-icon</code> 和 <code>right-icon</code> 配置输入框两侧的图标，通过设置 <code>clearable</code> 在输入过程中展示清除图标。</p>\n<pre><code class="language-html"><span class="hljs-tag">&lt;<span class="hljs-name">mi-cell-group</span> <span class="hljs-attr">inset</span>&gt;</span>\n    <span class="hljs-tag">&lt;<span class="hljs-name">mi-field</span>\n        <span class="hljs-attr">v-model</span>=<span class="hljs-string">&quot;value1&quot;</span>\n        <span class="hljs-attr">label</span>=<span class="hljs-string">&quot;文本&quot;</span>\n        <span class="hljs-attr">left-icon</span>=<span class="hljs-string">&quot;smile-o&quot;</span>\n        <span class="hljs-attr">right-icon</span>=<span class="hljs-string">&quot;warning-o&quot;</span>\n        <span class="hljs-attr">placeholder</span>=<span class="hljs-string">&quot;显示图标&quot;</span>\n    /&gt;</span>\n    <span class="hljs-tag">&lt;<span class="hljs-name">mi-field</span>\n        <span class="hljs-attr">v-model</span>=<span class="hljs-string">&quot;value2&quot;</span>\n        <span class="hljs-attr">clearable</span>\n        <span class="hljs-attr">label</span>=<span class="hljs-string">&quot;文本&quot;</span>\n        <span class="hljs-attr">left-icon</span>=<span class="hljs-string">&quot;music-o&quot;</span>\n        <span class="hljs-attr">placeholder</span>=<span class="hljs-string">&quot;显示清除图标&quot;</span>\n    /&gt;</span>\n<span class="hljs-tag">&lt;/<span class="hljs-name">mi-cell-group</span>&gt;</span>\n</code></pre>\n<pre><code class="language-js"><span class="hljs-keyword">import</span> { ref } <span class="hljs-keyword">from</span> <span class="hljs-string">&#x27;vue&#x27;</span>;\n\n<span class="hljs-keyword">export</span> <span class="hljs-keyword">default</span> {\n    <span class="hljs-title function_">setup</span>(<span class="hljs-params"></span>) {\n        <span class="hljs-keyword">const</span> value1 = <span class="hljs-title function_">ref</span>(<span class="hljs-string">&#x27;&#x27;</span>);\n        <span class="hljs-keyword">const</span> value2 = <span class="hljs-title function_">ref</span>(<span class="hljs-string">&#x27;123&#x27;</span>);\n        <span class="hljs-keyword">return</span> {\n            value1,\n            value2,\n        };\n    },\n};\n</code></pre>\n</div><div class="mi-doc-card"><h3 id="bi-tian-xing-hao" tabindex="-1">必填星号</h3>\n<p>设置 <code>required</code> 属性来展示必填星号。</p>\n<pre><code class="language-html"><span class="hljs-tag">&lt;<span class="hljs-name">mi-cell-group</span> <span class="hljs-attr">inset</span>&gt;</span>\n    <span class="hljs-tag">&lt;<span class="hljs-name">mi-field</span>\n        <span class="hljs-attr">v-model</span>=<span class="hljs-string">&quot;username&quot;</span>\n        <span class="hljs-attr">required</span>\n        <span class="hljs-attr">label</span>=<span class="hljs-string">&quot;用户名&quot;</span>\n        <span class="hljs-attr">placeholder</span>=<span class="hljs-string">&quot;请输入用户名&quot;</span>\n    /&gt;</span>\n    <span class="hljs-tag">&lt;<span class="hljs-name">mi-field</span>\n        <span class="hljs-attr">v-model</span>=<span class="hljs-string">&quot;phone&quot;</span>\n        <span class="hljs-attr">required</span>\n        <span class="hljs-attr">label</span>=<span class="hljs-string">&quot;手机号&quot;</span>\n        <span class="hljs-attr">placeholder</span>=<span class="hljs-string">&quot;请输入手机号&quot;</span>\n    /&gt;</span>\n<span class="hljs-tag">&lt;/<span class="hljs-name">mi-cell-group</span>&gt;</span>\n</code></pre>\n<p>请注意 <code>required</code> 属性只用于控制样式展示，在进行表单校验时，需要使用 <code>rule.required</code> 选项来控制校验逻辑。</p>\n</div><div class="mi-doc-card"><h3 id="zi-dong-zhan-shi-xing-hao" tabindex="-1">自动展示星号</h3>\n<p>你可以在 Form 组件上设置 <code>required=&quot;auto&quot;</code>，此时 Form 里的所有 Field 会自动根据 <code>rule.required</code> 来判断是否需要展示星号。</p>\n<pre><code class="language-html"><span class="hljs-tag">&lt;<span class="hljs-name">mi-form</span> <span class="hljs-attr">required</span>=<span class="hljs-string">&quot;auto&quot;</span>&gt;</span>\n    <span class="hljs-tag">&lt;<span class="hljs-name">mi-field</span>\n        <span class="hljs-attr">v-model</span>=<span class="hljs-string">&quot;username&quot;</span>\n        <span class="hljs-attr">:rules</span>=<span class="hljs-string">&quot;[{ required: true }]&quot;</span>\n        <span class="hljs-attr">label</span>=<span class="hljs-string">&quot;用户名&quot;</span>\n        <span class="hljs-attr">placeholder</span>=<span class="hljs-string">&quot;请输入用户名&quot;</span>\n    /&gt;</span>\n    <span class="hljs-tag">&lt;<span class="hljs-name">mi-field</span>\n        <span class="hljs-attr">v-model</span>=<span class="hljs-string">&quot;phone&quot;</span>\n        <span class="hljs-attr">:rules</span>=<span class="hljs-string">&quot;[{ required: false }]&quot;</span>\n        <span class="hljs-attr">label</span>=<span class="hljs-string">&quot;手机号&quot;</span>\n        <span class="hljs-attr">placeholder</span>=<span class="hljs-string">&quot;请输入手机号&quot;</span>\n    /&gt;</span>\n<span class="hljs-tag">&lt;/<span class="hljs-name">mi-form</span>&gt;</span>\n</code></pre>\n</div><div class="mi-doc-card"><h3 id="cuo-wu-ti-shi" tabindex="-1">错误提示</h3>\n<p>设置 <code>required</code> 属性表示这是一个必填项，可以配合 <code>error</code> 或 <code>error-message</code> 属性显示对应的错误提示。</p>\n<pre><code class="language-html"><span class="hljs-tag">&lt;<span class="hljs-name">mi-cell-group</span> <span class="hljs-attr">inset</span>&gt;</span>\n    <span class="hljs-tag">&lt;<span class="hljs-name">mi-field</span>\n        <span class="hljs-attr">v-model</span>=<span class="hljs-string">&quot;username&quot;</span>\n        <span class="hljs-attr">error</span>\n        <span class="hljs-attr">label</span>=<span class="hljs-string">&quot;用户名&quot;</span>\n        <span class="hljs-attr">placeholder</span>=<span class="hljs-string">&quot;请输入用户名&quot;</span>\n    /&gt;</span>\n    <span class="hljs-tag">&lt;<span class="hljs-name">mi-field</span>\n        <span class="hljs-attr">v-model</span>=<span class="hljs-string">&quot;phone&quot;</span>\n        <span class="hljs-attr">label</span>=<span class="hljs-string">&quot;手机号&quot;</span>\n        <span class="hljs-attr">placeholder</span>=<span class="hljs-string">&quot;请输入手机号&quot;</span>\n        <span class="hljs-attr">error-message</span>=<span class="hljs-string">&quot;手机号格式错误&quot;</span>\n    /&gt;</span>\n<span class="hljs-tag">&lt;/<span class="hljs-name">mi-cell-group</span>&gt;</span>\n</code></pre>\n</div><div class="mi-doc-card"><h3 id="cha-ru-an-niu" tabindex="-1">插入按钮</h3>\n<p>通过 button 插槽可以在输入框尾部插入按钮。</p>\n<pre><code class="language-html"><span class="hljs-tag">&lt;<span class="hljs-name">mi-cell-group</span> <span class="hljs-attr">inset</span>&gt;</span>\n    <span class="hljs-tag">&lt;<span class="hljs-name">mi-field</span>\n        <span class="hljs-attr">v-model</span>=<span class="hljs-string">&quot;sms&quot;</span>\n        <span class="hljs-attr">center</span>\n        <span class="hljs-attr">clearable</span>\n        <span class="hljs-attr">label</span>=<span class="hljs-string">&quot;短信验证码&quot;</span>\n        <span class="hljs-attr">placeholder</span>=<span class="hljs-string">&quot;请输入短信验证码&quot;</span>\n    &gt;</span>\n        <span class="hljs-tag">&lt;<span class="hljs-name">template</span> #<span class="hljs-attr">button</span>&gt;</span>\n            <span class="hljs-tag">&lt;<span class="hljs-name">mi-button</span> <span class="hljs-attr">size</span>=<span class="hljs-string">&quot;small&quot;</span> <span class="hljs-attr">type</span>=<span class="hljs-string">&quot;primary&quot;</span>&gt;</span>发送验证码<span class="hljs-tag">&lt;/<span class="hljs-name">mi-button</span>&gt;</span>\n        <span class="hljs-tag">&lt;/<span class="hljs-name">template</span>&gt;</span>\n    <span class="hljs-tag">&lt;/<span class="hljs-name">mi-field</span>&gt;</span>\n<span class="hljs-tag">&lt;/<span class="hljs-name">mi-cell-group</span>&gt;</span>\n</code></pre>\n</div><div class="mi-doc-card"><h3 id="ge-shi-hua-shu-ru-nei-rong" tabindex="-1">格式化输入内容</h3>\n<p>通过 <code>formatter</code> 属性可以对输入的内容进行格式化，通过 <code>format-trigger</code> 属性可以指定执行格式化的时机，默认在输入时进行格式化。</p>\n<pre><code class="language-html"><span class="hljs-tag">&lt;<span class="hljs-name">mi-cell-group</span> <span class="hljs-attr">inset</span>&gt;</span>\n    <span class="hljs-tag">&lt;<span class="hljs-name">mi-field</span>\n        <span class="hljs-attr">v-model</span>=<span class="hljs-string">&quot;value1&quot;</span>\n        <span class="hljs-attr">label</span>=<span class="hljs-string">&quot;文本&quot;</span>\n        <span class="hljs-attr">:formatter</span>=<span class="hljs-string">&quot;formatter&quot;</span>\n        <span class="hljs-attr">placeholder</span>=<span class="hljs-string">&quot;在输入时执行格式化&quot;</span>\n    /&gt;</span>\n    <span class="hljs-tag">&lt;<span class="hljs-name">mi-field</span>\n        <span class="hljs-attr">v-model</span>=<span class="hljs-string">&quot;value2&quot;</span>\n        <span class="hljs-attr">label</span>=<span class="hljs-string">&quot;文本&quot;</span>\n        <span class="hljs-attr">:formatter</span>=<span class="hljs-string">&quot;formatter&quot;</span>\n        <span class="hljs-attr">format-trigger</span>=<span class="hljs-string">&quot;onBlur&quot;</span>\n        <span class="hljs-attr">placeholder</span>=<span class="hljs-string">&quot;在失焦时执行格式化&quot;</span>\n    /&gt;</span>\n<span class="hljs-tag">&lt;/<span class="hljs-name">mi-cell-group</span>&gt;</span>\n</code></pre>\n<pre><code class="language-js"><span class="hljs-keyword">import</span> { ref } <span class="hljs-keyword">from</span> <span class="hljs-string">&#x27;vue&#x27;</span>;\n\n<span class="hljs-keyword">export</span> <span class="hljs-keyword">default</span> {\n    <span class="hljs-title function_">setup</span>(<span class="hljs-params"></span>) {\n        <span class="hljs-keyword">const</span> value1 = <span class="hljs-title function_">ref</span>(<span class="hljs-string">&#x27;&#x27;</span>);\n        <span class="hljs-keyword">const</span> value2 = <span class="hljs-title function_">ref</span>(<span class="hljs-string">&#x27;&#x27;</span>);\n        <span class="hljs-comment">// 过滤输入的数字</span>\n        <span class="hljs-keyword">const</span> <span class="hljs-title function_">formatter</span> = (<span class="hljs-params">value</span>) =&gt; value.<span class="hljs-title function_">replace</span>(<span class="hljs-regexp">/\\d/g</span>, <span class="hljs-string">&#x27;&#x27;</span>);\n\n        <span class="hljs-keyword">return</span> {\n            value1,\n            value2,\n            formatter,\n        };\n    },\n};\n</code></pre>\n</div><div class="mi-doc-card"><h3 id="gao-du-zi-gua-ying" tabindex="-1">高度自适应</h3>\n<p>对于 textarea，可以通过 <code>autosize</code> 属性设置高度自适应。</p>\n<pre><code class="language-html"><span class="hljs-tag">&lt;<span class="hljs-name">mi-cell-group</span> <span class="hljs-attr">inset</span>&gt;</span>\n    <span class="hljs-tag">&lt;<span class="hljs-name">mi-field</span>\n        <span class="hljs-attr">v-model</span>=<span class="hljs-string">&quot;message&quot;</span>\n        <span class="hljs-attr">rows</span>=<span class="hljs-string">&quot;1&quot;</span>\n        <span class="hljs-attr">autosize</span>\n        <span class="hljs-attr">label</span>=<span class="hljs-string">&quot;留言&quot;</span>\n        <span class="hljs-attr">type</span>=<span class="hljs-string">&quot;textarea&quot;</span>\n        <span class="hljs-attr">placeholder</span>=<span class="hljs-string">&quot;请输入留言&quot;</span>\n    /&gt;</span>\n<span class="hljs-tag">&lt;/<span class="hljs-name">mi-cell-group</span>&gt;</span>\n</code></pre>\n</div><div class="mi-doc-card"><h3 id="xian-shi-zi-shu-tong-ji" tabindex="-1">显示字数统计</h3>\n<p>设置 <code>maxlength</code> 和 <code>show-word-limit</code> 属性后会在底部显示字数统计。</p>\n<pre><code class="language-html"><span class="hljs-tag">&lt;<span class="hljs-name">mi-cell-group</span> <span class="hljs-attr">inset</span>&gt;</span>\n    <span class="hljs-tag">&lt;<span class="hljs-name">mi-field</span>\n        <span class="hljs-attr">v-model</span>=<span class="hljs-string">&quot;message&quot;</span>\n        <span class="hljs-attr">rows</span>=<span class="hljs-string">&quot;2&quot;</span>\n        <span class="hljs-attr">autosize</span>\n        <span class="hljs-attr">label</span>=<span class="hljs-string">&quot;留言&quot;</span>\n        <span class="hljs-attr">type</span>=<span class="hljs-string">&quot;textarea&quot;</span>\n        <span class="hljs-attr">maxlength</span>=<span class="hljs-string">&quot;50&quot;</span>\n        <span class="hljs-attr">placeholder</span>=<span class="hljs-string">&quot;请输入留言&quot;</span>\n        <span class="hljs-attr">show-word-limit</span>\n    /&gt;</span>\n<span class="hljs-tag">&lt;/<span class="hljs-name">mi-cell-group</span>&gt;</span>\n</code></pre>\n</div><div class="mi-doc-card"><h3 id="shu-ru-kuang-nei-rong-dui-qi" tabindex="-1">输入框内容对齐</h3>\n<p>通过 <code>input-align</code> 属性可以设置输入框内容的对齐方式，可选值为 <code>center</code>、<code>right</code>。</p>\n<pre><code class="language-html"><span class="hljs-tag">&lt;<span class="hljs-name">mi-cell-group</span> <span class="hljs-attr">inset</span>&gt;</span>\n    <span class="hljs-tag">&lt;<span class="hljs-name">mi-field</span>\n        <span class="hljs-attr">v-model</span>=<span class="hljs-string">&quot;value&quot;</span>\n        <span class="hljs-attr">label</span>=<span class="hljs-string">&quot;文本&quot;</span>\n        <span class="hljs-attr">placeholder</span>=<span class="hljs-string">&quot;输入框内容右对齐&quot;</span>\n        <span class="hljs-attr">input-align</span>=<span class="hljs-string">&quot;right&quot;</span>\n    /&gt;</span>\n<span class="hljs-tag">&lt;/<span class="hljs-name">mi-cell-group</span>&gt;</span>\n</code></pre>\n</div><div class="mi-doc-card"><h3 id="shu-ru-kuang-wen-ben-wei-zhi" tabindex="-1">输入框文本位置</h3>\n<p>通过 <code>label-align</code> 属性可以设置输入框文本的位置，可选值为 <code>center</code>、<code>right</code>、<code>top</code>。</p>\n<pre><code class="language-html"><span class="hljs-tag">&lt;<span class="hljs-name">mi-cell-group</span> <span class="hljs-attr">inset</span>&gt;</span>\n    <span class="hljs-tag">&lt;<span class="hljs-name">mi-field</span>\n        <span class="hljs-attr">v-model</span>=<span class="hljs-string">&quot;value&quot;</span>\n        <span class="hljs-attr">label</span>=<span class="hljs-string">&quot;文本&quot;</span>\n        <span class="hljs-attr">placeholder</span>=<span class="hljs-string">&quot;顶部对齐&quot;</span>\n        <span class="hljs-attr">label-align</span>=<span class="hljs-string">&quot;top&quot;</span>\n    /&gt;</span>\n    <span class="hljs-tag">&lt;<span class="hljs-name">mi-field</span>\n        <span class="hljs-attr">v-model</span>=<span class="hljs-string">&quot;value2&quot;</span>\n        <span class="hljs-attr">label</span>=<span class="hljs-string">&quot;文本&quot;</span>\n        <span class="hljs-attr">placeholder</span>=<span class="hljs-string">&quot;左对齐&quot;</span>\n        <span class="hljs-attr">label-align</span>=<span class="hljs-string">&quot;left&quot;</span>\n    /&gt;</span>\n    <span class="hljs-tag">&lt;<span class="hljs-name">mi-field</span>\n        <span class="hljs-attr">v-model</span>=<span class="hljs-string">&quot;value3&quot;</span>\n        <span class="hljs-attr">label</span>=<span class="hljs-string">&quot;文本&quot;</span>\n        <span class="hljs-attr">placeholder</span>=<span class="hljs-string">&quot;居中对齐&quot;</span>\n        <span class="hljs-attr">label-align</span>=<span class="hljs-string">&quot;center&quot;</span>\n    /&gt;</span>\n    <span class="hljs-tag">&lt;<span class="hljs-name">mi-field</span>\n        <span class="hljs-attr">v-model</span>=<span class="hljs-string">&quot;value4&quot;</span>\n        <span class="hljs-attr">label</span>=<span class="hljs-string">&quot;文本&quot;</span>\n        <span class="hljs-attr">placeholder</span>=<span class="hljs-string">&quot;右对齐&quot;</span>\n        <span class="hljs-attr">label-align</span>=<span class="hljs-string">&quot;right&quot;</span>\n    /&gt;</span>\n<span class="hljs-tag">&lt;/<span class="hljs-name">mi-cell-group</span>&gt;</span>\n</code></pre>\n</div><h2 id="api" tabindex="-1">API</h2>\n<div class="mi-doc-card"><h3 id="props" tabindex="-1">Props</h3>\n<table>\n<thead>\n<tr>\n<th>参数</th>\n<th>说明</th>\n<th>类型</th>\n<th>默认值</th>\n</tr>\n</thead>\n<tbody>\n<tr>\n<td>v-model</td>\n<td>当前输入的值</td>\n<td><em>number | string</em></td>\n<td>-</td>\n</tr>\n<tr>\n<td>label</td>\n<td>输入框左侧文本</td>\n<td><em>string</em></td>\n<td>-</td>\n</tr>\n<tr>\n<td>name</td>\n<td>名称，作为提交表单时的标识符</td>\n<td><em>string</em></td>\n<td>-</td>\n</tr>\n<tr>\n<td>id</td>\n<td>输入框 id，同时会设置 label 的 for 属性</td>\n<td><em>string</em></td>\n<td><code>mi-field-n-input</code></td>\n</tr>\n<tr>\n<td>type</td>\n<td>输入框类型, 支持原生 input 标签的所有 <a href="https://developer.mozilla.org/zh-CN/docs/Web/HTML/Element/input#%3Cinput%3E_types" target="_blank">type 属性</a>，额外支持了 <code>digit</code> 类型</td>\n<td><em>FieldType</em></td>\n<td><code>text</code></td>\n</tr>\n<tr>\n<td>size</td>\n<td>大小，可选值为 <code>large</code> <code>normal</code></td>\n<td><em>string</em></td>\n<td>-</td>\n</tr>\n<tr>\n<td>maxlength</td>\n<td>输入的最大字符数</td>\n<td><em>number | string</em></td>\n<td>-</td>\n</tr>\n<tr>\n<td>min</td>\n<td>输入框类型为 <code>number</code> 或 <code>digit</code> 类型时设置可允许的最小值</td>\n<td>_number</td>\n<td>-</td>\n</tr>\n<tr>\n<td>max</td>\n<td>输入框类型为 <code>number</code> 或 <code>digit</code> 类型时设置可允许的最大值</td>\n<td>_number</td>\n<td>-</td>\n</tr>\n<tr>\n<td>placeholder</td>\n<td>输入框占位提示文字</td>\n<td><em>string</em></td>\n<td>-</td>\n</tr>\n<tr>\n<td>border</td>\n<td>是否显示内边框</td>\n<td><em>boolean</em></td>\n<td><code>true</code></td>\n</tr>\n<tr>\n<td>disabled</td>\n<td>是否禁用输入框</td>\n<td><em>boolean</em></td>\n<td><code>false</code></td>\n</tr>\n<tr>\n<td>readonly</td>\n<td>是否为只读状态，只读状态下无法输入内容</td>\n<td><em>boolean</em></td>\n<td><code>false</code></td>\n</tr>\n<tr>\n<td>colon</td>\n<td>是否在 label 后面添加冒号</td>\n<td><em>boolean</em></td>\n<td><code>false</code></td>\n</tr>\n<tr>\n<td>required</td>\n<td>是否显示表单必填星号</td>\n<td><em>boolean | \'auto\'</em></td>\n<td><code>null</code></td>\n</tr>\n<tr>\n<td>center</td>\n<td>是否使内容垂直居中</td>\n<td><em>boolean</em></td>\n<td><code>false</code></td>\n</tr>\n<tr>\n<td>clearable</td>\n<td>是否启用清除图标，点击清除图标后会清空输入框</td>\n<td><em>boolean</em></td>\n<td><code>false</code></td>\n</tr>\n<tr>\n<td>clear-icon</td>\n<td>清除图标名称或图片链接，等同于 Icon 组件的 <a href="#/zh-CN/icon#props" target="_blank">name 属性</a></td>\n<td><em>string</em></td>\n<td><code>clear</code></td>\n</tr>\n<tr>\n<td>clear-trigger</td>\n<td>显示清除图标的时机，<code>always</code> 表示输入框不为空时展示，<br><code>focus</code> 表示输入框聚焦且不为空时展示</td>\n<td><em>FieldClearTrigger</em></td>\n<td><code>focus</code></td>\n</tr>\n<tr>\n<td>clickable</td>\n<td>是否开启点击反馈</td>\n<td><em>boolean</em></td>\n<td><code>false</code></td>\n</tr>\n<tr>\n<td>is-link</td>\n<td>是否展示右侧箭头并开启点击反馈</td>\n<td><em>boolean</em></td>\n<td><code>false</code></td>\n</tr>\n<tr>\n<td>autofocus</td>\n<td>是否自动聚焦，iOS 系统不支持该属性</td>\n<td><em>boolean</em></td>\n<td><code>false</code></td>\n</tr>\n<tr>\n<td>show-word-limit</td>\n<td>是否显示字数统计，需要设置 <code>maxlength</code> 属性</td>\n<td><em>boolean</em></td>\n<td><code>false</code></td>\n</tr>\n<tr>\n<td>error</td>\n<td>是否将输入内容标红</td>\n<td><em>boolean</em></td>\n<td><code>false</code></td>\n</tr>\n<tr>\n<td>error-message</td>\n<td>底部错误提示文案，为空时不展示</td>\n<td><em>string</em></td>\n<td>-</td>\n</tr>\n<tr>\n<td>error-message-align</td>\n<td>错误提示文案对齐方式，可选值为 <code>center</code> <code>right</code></td>\n<td><em>FieldTextAlign</em></td>\n<td><code>left</code></td>\n</tr>\n<tr>\n<td>formatter</td>\n<td>输入内容格式化函数</td>\n<td><em>(val: string) =&gt; string</em></td>\n<td>-</td>\n</tr>\n<tr>\n<td>format-trigger</td>\n<td>格式化函数触发的时机，可选值为 <code>onBlur</code></td>\n<td><em>FieldFormatTrigger</em></td>\n<td><code>onChange</code></td>\n</tr>\n<tr>\n<td>arrow-direction</td>\n<td>箭头方向，可选值为 <code>left</code> <code>up</code> <code>down</code></td>\n<td><em>string</em></td>\n<td><code>right</code></td>\n</tr>\n<tr>\n<td>label-class</td>\n<td>左侧文本额外类名</td>\n<td><em>string | Array | object</em></td>\n<td>-</td>\n</tr>\n<tr>\n<td>label-width</td>\n<td>左侧文本宽度，默认单位为 <code>px</code></td>\n<td><em>number | string</em></td>\n<td><code>6.2em</code></td>\n</tr>\n<tr>\n<td>label-align</td>\n<td>左侧文本对齐方式，可选值为 <code>center</code> <code>right</code> <code>top</code></td>\n<td><em>FieldTextAlign</em></td>\n<td><code>left</code></td>\n</tr>\n<tr>\n<td>input-align</td>\n<td>输入框对齐方式，可选值为 <code>center</code> <code>right</code></td>\n<td><em>FieldTextAlign</em></td>\n<td><code>left</code></td>\n</tr>\n<tr>\n<td>autosize</td>\n<td>是否自适应内容高度，只对 textarea 有效，<br>可传入对象,如 { maxHeight: 100, minHeight: 50 }，<br>单位为<code>px</code></td>\n<td><em>boolean | FieldAutosizeConfig</em></td>\n<td><code>false</code></td>\n</tr>\n<tr>\n<td>left-icon</td>\n<td>左侧图标名称或图片链接，等同于 Icon 组件的 <a href="#/zh-CN/icon#props" target="_blank">name 属性</a></td>\n<td><em>string</em></td>\n<td>-</td>\n</tr>\n<tr>\n<td>right-icon</td>\n<td>右侧图标名称或图片链接，等同于 Icon 组件的 <a href="#/zh-CN/icon#props" target="_blank">name 属性</a></td>\n<td><em>string</em></td>\n<td>-</td>\n</tr>\n<tr>\n<td>icon-prefix</td>\n<td>图标类名前缀，等同于 Icon 组件的 <a href="#/zh-CN/icon#props" target="_blank">class-prefix 属性</a></td>\n<td><em>string</em></td>\n<td><code>mi-icon</code></td>\n</tr>\n<tr>\n<td>rules</td>\n<td>表单校验规则，详见 <a href="#/zh-CN/form#rule-shu-ju-jie-gou" target="_blank">Form 组件</a></td>\n<td><em>FieldRule[]</em></td>\n<td>-</td>\n</tr>\n<tr>\n<td>autocomplete</td>\n<td>HTML 原生属性，用于控制自动完成功能，详见 <a href="https://developer.mozilla.org/en-US/docs/Web/HTML/Attributes/autocomplete" target="_blank">MDN - autocomplete</a></td>\n<td><em>string</em></td>\n<td>-</td>\n</tr>\n<tr>\n<td>autocapitalize <code>v4.6.2</code></td>\n<td>HTML 原生属性，用于控制文本输入时是否自动大写，此 API 仅在部分浏览器支持，详见 <a href="https://developer.mozilla.org/en-US/docs/Web/HTML/Global_attributes/autocapitalize" target="_blank">MDN - autocapitalize</a></td>\n<td><em>string</em></td>\n<td>-</td>\n</tr>\n<tr>\n<td>enterkeyhint</td>\n<td>HTML 原生属性，用于控制回车键样式，此 API 仅在部分浏览器支持，详见 <a href="https://developer.mozilla.org/en-US/docs/Web/HTML/Global_attributes/enterkeyhint" target="_blank">MDN - enterkeyhint</a><br></td>\n<td><em>string</em></td>\n<td>-</td>\n</tr>\n<tr>\n<td>spellcheck <code>v4.6.2</code></td>\n<td>HTML 原生属性，用于检查元素的拼写错误，此 API 仅在部分浏览器支持，详见 <a href="https://developer.mozilla.org/en-US/docs/Web/HTML/Global_attributes/spellcheck" target="_blank">MDN - spellcheck</a><br></td>\n<td><em>boolean</em></td>\n<td>-</td>\n</tr>\n<tr>\n<td>autocorrect <code>v4.6.2</code></td>\n<td>仅 Safari 适用，用于自动更正输入的文本，详见 <a href="https://developer.mozilla.org/en-US/docs/Web/HTML/Element/input#autocorrect" target="_blank">MDN - autocorrect</a><br></td>\n<td><em>string</em></td>\n<td>-</td>\n</tr>\n</tbody>\n</table>\n</div><div class="mi-doc-card"><h3 id="events" tabindex="-1">Events</h3>\n<table>\n<thead>\n<tr>\n<th>事件名</th>\n<th>说明</th>\n<th>回调参数</th>\n</tr>\n</thead>\n<tbody>\n<tr>\n<td>update:model-value</td>\n<td>输入框内容变化时触发</td>\n<td><em>value: string (当前输入的值)</em></td>\n</tr>\n<tr>\n<td>focus</td>\n<td>输入框获得焦点时触发</td>\n<td><em>event: Event</em></td>\n</tr>\n<tr>\n<td>blur</td>\n<td>输入框失去焦点时触发</td>\n<td><em>event: Event</em></td>\n</tr>\n<tr>\n<td>clear</td>\n<td>点击清除按钮时触发</td>\n<td><em>event: MouseEvent</em></td>\n</tr>\n<tr>\n<td>click</td>\n<td>点击组件时触发</td>\n<td><em>event: MouseEvent</em></td>\n</tr>\n<tr>\n<td>click-input</td>\n<td>点击输入区域时触发</td>\n<td><em>event: MouseEvent</em></td>\n</tr>\n<tr>\n<td>click-left-icon</td>\n<td>点击左侧图标时触发</td>\n<td><em>event: MouseEvent</em></td>\n</tr>\n<tr>\n<td>click-right-icon</td>\n<td>点击右侧图标时触发</td>\n<td><em>event: MouseEvent</em></td>\n</tr>\n<tr>\n<td>start-validate</td>\n<td>开始表单校验时触发</td>\n<td>-</td>\n</tr>\n<tr>\n<td>end-validate</td>\n<td>结束表单校验时触发</td>\n<td><em>{ status: string, message: string }</em></td>\n</tr>\n</tbody>\n</table>\n</div><div class="mi-doc-card"><h3 id="fang-fa" tabindex="-1">方法</h3>\n<p>通过 ref 可以获取到 Field 实例并调用实例方法，详见<a href="#/zh-CN/advanced-usage#zu-jian-shi-li-fang-fa" target="_blank">组件实例方法</a>。</p>\n<table>\n<thead>\n<tr>\n<th>方法名</th>\n<th>说明</th>\n<th>参数</th>\n<th>返回值</th>\n</tr>\n</thead>\n<tbody>\n<tr>\n<td>focus</td>\n<td>获取输入框焦点</td>\n<td>-</td>\n<td>-</td>\n</tr>\n<tr>\n<td>blur</td>\n<td>取消输入框焦点</td>\n<td>-</td>\n<td>-</td>\n</tr>\n</tbody>\n</table>\n</div><div class="mi-doc-card"><h3 id="lei-xing-ding-yi" tabindex="-1">类型定义</h3>\n<p>组件导出以下类型定义：</p>\n<pre><code class="language-ts"><span class="hljs-keyword">import</span> <span class="hljs-keyword">type</span> {\n    <span class="hljs-title class_">FieldType</span>,\n    <span class="hljs-title class_">FieldRule</span>,\n    <span class="hljs-title class_">FieldProps</span>,\n    <span class="hljs-title class_">FieldInstance</span>,\n    <span class="hljs-title class_">FieldTextAlign</span>,\n    <span class="hljs-title class_">FieldRuleMessage</span>,\n    <span class="hljs-title class_">FieldClearTrigger</span>,\n    <span class="hljs-title class_">FieldFormatTrigger</span>,\n    <span class="hljs-title class_">FieldRuleValidator</span>,\n    <span class="hljs-title class_">FieldRuleFormatter</span>,\n    <span class="hljs-title class_">FieldValidateError</span>,\n    <span class="hljs-title class_">FieldAutosizeConfig</span>,\n    <span class="hljs-title class_">FieldValidateTrigger</span>,\n    <span class="hljs-title class_">FieldValidationStatus</span>,\n} <span class="hljs-keyword">from</span> <span class="hljs-string">&#x27;@miracle-web/ui&#x27;</span>;\n</code></pre>\n<p><code>FieldInstance</code> 是组件实例的类型，用法如下：</p>\n<pre><code class="language-ts"><span class="hljs-keyword">import</span> { ref } <span class="hljs-keyword">from</span> <span class="hljs-string">&#x27;vue&#x27;</span>;\n<span class="hljs-keyword">import</span> <span class="hljs-keyword">type</span> { <span class="hljs-title class_">FieldInstance</span> } <span class="hljs-keyword">from</span> <span class="hljs-string">&#x27;@miracle-web/ui&#x27;</span>;\n\n<span class="hljs-keyword">const</span> fieldRef = ref&lt;<span class="hljs-title class_">FieldInstance</span>&gt;();\n\nfieldRef.<span class="hljs-property">value</span>?.<span class="hljs-title function_">focus</span>();\n</code></pre>\n</div><div class="mi-doc-card"><h3 id="slots" tabindex="-1">Slots</h3>\n<table>\n<thead>\n<tr>\n<th>名称</th>\n<th>说明</th>\n<th>参数</th>\n</tr>\n</thead>\n<tbody>\n<tr>\n<td>label</td>\n<td>自定义输入框左侧文本</td>\n<td>-</td>\n</tr>\n<tr>\n<td>input</td>\n<td>自定义输入框，使用此插槽后，与输入框相关的属性和事件将失效</td>\n<td>-</td>\n</tr>\n<tr>\n<td>left-icon</td>\n<td>自定义输入框头部图标</td>\n<td>-</td>\n</tr>\n<tr>\n<td>right-icon</td>\n<td>自定义输入框尾部图标</td>\n<td>-</td>\n</tr>\n<tr>\n<td>button</td>\n<td>自定义输入框尾部按钮</td>\n<td>-</td>\n</tr>\n<tr>\n<td>error-message</td>\n<td>自定义底部错误提示文案</td>\n<td><em>{ message: string }</em></td>\n</tr>\n<tr>\n<td>extra</td>\n<td>自定义输入框最右侧的额外内容</td>\n<td>-</td>\n</tr>\n</tbody>\n</table>\n</div><h2 id="zhu-ti-ding-zhi" tabindex="-1">主题定制</h2>\n<div class="mi-doc-card"><h3 id="yang-shi-bian-liang" tabindex="-1">样式变量</h3>\n<p>组件提供了下列 CSS 变量，可用于自定义样式，使用方法请参考 <a href="#/zh-CN/config-provider" target="_blank">ConfigProvider 组件</a>。</p>\n<table>\n<thead>\n<tr>\n<th>名称</th>\n<th>默认值</th>\n<th>描述</th>\n</tr>\n</thead>\n<tbody>\n<tr>\n<td>--mi-field-label-width</td>\n<td><em>6.2em</em></td>\n<td>-</td>\n</tr>\n<tr>\n<td>--mi-field-label-color</td>\n<td><em>var(--mi-text-color)</em></td>\n<td>-</td>\n</tr>\n<tr>\n<td>--mi-field-label-margin-right</td>\n<td><em>var(--mi-padding-sm)</em></td>\n<td>-</td>\n</tr>\n<tr>\n<td>--mi-field-input-text-color</td>\n<td><em>var(--mi-text-color)</em></td>\n<td>-</td>\n</tr>\n<tr>\n<td>--mi-field-input-error-text-color</td>\n<td><em>var(--mi-danger-color)</em></td>\n<td>-</td>\n</tr>\n<tr>\n<td>--mi-field-input-disabled-text-color</td>\n<td><em>var(--mi-text-color-3)</em></td>\n<td>-</td>\n</tr>\n<tr>\n<td>--mi-field-placeholder-text-color</td>\n<td><em>var(--mi-text-color-3)</em></td>\n<td>-</td>\n</tr>\n<tr>\n<td>--mi-field-icon-size</td>\n<td><em>18px</em></td>\n<td>-</td>\n</tr>\n<tr>\n<td>--mi-field-clear-icon-size</td>\n<td><em>18px</em></td>\n<td>-</td>\n</tr>\n<tr>\n<td>--mi-field-clear-icon-color</td>\n<td><em>var(--mi-gray-5)</em></td>\n<td>-</td>\n</tr>\n<tr>\n<td>--mi-field-right-icon-color</td>\n<td><em>var(--mi-gray-6)</em></td>\n<td>-</td>\n</tr>\n<tr>\n<td>--mi-field-error-message-color</td>\n<td><em>var(--mi-danger-color)</em></td>\n<td>-</td>\n</tr>\n<tr>\n<td>--mi-field-error-message-font-size</td>\n<td><em>12px</em></td>\n<td>-</td>\n</tr>\n<tr>\n<td>--mi-field-text-area-min-height</td>\n<td><em>60px</em></td>\n<td>-</td>\n</tr>\n<tr>\n<td>--mi-field-word-limit-color</td>\n<td><em>var(--mi-gray-7)</em></td>\n<td>-</td>\n</tr>\n<tr>\n<td>--mi-field-word-limit-font-size</td>\n<td><em>var(--mi-font-size-sm)</em></td>\n<td>-</td>\n</tr>\n<tr>\n<td>--mi-field-word-limit-line-height</td>\n<td><em>16px</em></td>\n<td>-</td>\n</tr>\n<tr>\n<td>--mi-field-disabled-text-color</td>\n<td><em>var(--mi-text-color-3)</em></td>\n<td>-</td>\n</tr>\n<tr>\n<td>--mi-field-required-mark-color</td>\n<td><em>var(--mi-red)</em></td>\n<td>-</td>\n</tr>\n</tbody>\n</table>\n</div><h2 id="chang-jian-wen-ti" tabindex="-1">常见问题</h2>\n<div class="mi-doc-card"><h3 id="she-zhi-type-wei-number-hou-wei-shi-me-input-biao-qian-de-lei-xing-reng-wei-text" tabindex="-1">设置 type 为 number 后，为什么 input 标签的类型仍为 text?</h3>\n<p>HTML 原生的 <code>type=&quot;number&quot;</code> 属性在 iOS 和 Android 系统上都存在一定问题，比如 maxlength 属性不生效、无法获取到完整的输入内容等。因此设置 type 为 <code>number</code> 时，Field 不会使用原生的 <code>type=&quot;number&quot;</code> 属性，而是用现代浏览器支持的 <a href="https://developer.mozilla.org/zh-CN/docs/Web/HTML/Global_attributes/inputmode" target="_blank">inputmode 属性</a>来控制输入键盘的类型。</p>\n</div><div class="mi-doc-card"><h3 id="wei-shi-me-v-model-bang-ding-de-zhi-bei-geng-xin-wei-string-lei-xing" tabindex="-1">为什么 v-model 绑定的值被更新为 string 类型？</h3>\n<p>Field 组件内部会将传入的 v-model 格式化为 string 类型，便于组件内部进行处理。</p>\n<p>如果你希望在 v-model 上绑定 number 类型，可以使用 Vue 提供的 <a href="https://vuejs.org/guide/essentials/forms.html#lazy" target="_blank">.number 修饰符</a>。</p>\n<pre><code class="language-html"><span class="hljs-tag">&lt;<span class="hljs-name">mi-field</span> <span class="hljs-attr">v-model.number</span>=<span class="hljs-string">&quot;value&quot;</span> <span class="hljs-attr">type</span>=<span class="hljs-string">&quot;tel&quot;</span> /&gt;</span>\n</code></pre>\n</div><div class="mi-doc-card"><h3 id="zai-zhuo-mian-duan-dian-ji-qing-chu-an-niu-wu-xiao" tabindex="-1">在桌面端点击清除按钮无效？</h3>\n<p>清除按钮监听是的移动端 Touch 事件，参见<a href="#/zh-CN/advanced-usage#zhuo-mian-duan-gua-pei" target="_blank">桌面端适配</a>。</p>\n</div>'},null,8,l))}}}]);